import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Login from "./routes/login/index";
import Register from "./routes/register/index";
import ForgotPassword from "./routes/forgot-password/index";
import Home from "./routes/home/index";
import OnGoingActivity from "./routes/on-going-activity/index";
import History from "./routes/history/index";
import Profile from "./routes/profile/index";
import Services from "./routes/services/index";
import registerServiceWorker from "./registerServiceWorker";
render(
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Login />} />
      <Route path="login" element={<Login />} />
      <Route path="register" element={ <Register />} />
          <Route path="forgot-password" element={<ForgotPassword />} />
      {localStorage.getItem("session") != undefined && 
          <Route path="home" element={<Home />} />

        }

    </Routes>
  </BrowserRouter>,
  document.getElementById('root')
);



// If you want to start measuring performance in your app, pass a function
